$(function() {
	// Accordeon-----------------------------------
		() => {alert('skotnik')}
		$('.acordeon-link').click(function(e) {
			e.preventDefault();
			var $currentItem = $(this).closest('.acordeon-item');
			if($currentItem.hasClass('acordeon-item-with-sublist')){

				$currentItem.find('.acordeon-sublist')
					.stop(true, true)
					.slideToggle();
				$currentItem.siblings()
					
					.find('.acordeon-sublist')
					.stop(true, true)
					.slideUp();

				$currentItem
					.toggleClass('active')
					.siblings()
					.removeClass('active');
			}else{
				return;
			}
		});
		// end Accordeon-----------------------------------
	new JCLeftMenu({
		'signedParamsString':'.3fd57486f36908c827dd0781c2326a696a4feefb400d77bbc8c60319f2c23cfb',
		'isContractor':false,
		'closeMenu':'Y',
		'switchShow':'N',
		'switchLeftName':'Заказчик',
		'switchLeftLink':'/service/tasks-new/',
		'switchLeftTitle':'Создать заказ',
		'switchRightName':'Исполнитель',
		'switchRightLink':'/service/',
		'switchRightTitle':'Все заказы',
		'templateFolder':'/local/templates/youdo_appforsale/components/bitrix/menu/appforsale',
		'LEFT':'N',
		'AJAX':false,
		'ASIDE_BG':'#FFFFFF',
		'ASIDE_LOGIN_BG':'default'});

});

